import React, { Component } from 'react';
import './App.css';
import NaviMenu from './NaviMenu';

const metaInfo = [
  {
    gitathonLogo : "./img/gitathonLogo.png",
    userName : "장예솔",
    hackathonLogo : "./img/hackathonLogo.png",
    profileLogo : "./img/profileLogo.png"
  }
]

class App extends Component {
  state = {

  }

  componentWillMont(){
    this.setState({
      naviMenu
    })
  }

  __renderNaviMenu = () =>{
    const naviMenu = this.state.naviMenu.map(naviMenu => {
        return <NaviMenu
          gitathonLogo = {metaInfo.gitathonLogo}
          userName = {metaInfo.userName}
          hackathonLogo = {metaInfo.hackathonLogo}
          profileLogo = {metaInfo.profileLogo}
        />
    })
    return naviMenu
  }

  render() {
    return (
      <div className="App">
        {this.state.naviMenu ? this.__renderNaviMenu() : 'Loading'}
      </div>
    );
  }
}

export default App;
